      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'start', marginBottom: '12px' }}>
        <div>
          <div style={{
            display: 'inline-block',
            background: 'linear-gradient(135deg, #e8f0fe 0%, #f0f7ff 100%)',
            color: '#357abd',
            padding: '6px 14px',
            borderRadius: '6px',
            fontSize: '13px',
            fontWeight: '600',
            marginBottom: '8px'
          }}>
            {question.category}
          </div>
        </div>
        <span style={{
          fontSize: '12px',
          color: '#5a7ba6',
          fontWeight: '500'
